const List_Types = {
	Backlog: 'backlog',
	InProgress: 'inProgress',
	Ready: 'ready',
	Done: 'done',
  }
  const List_Types_Show = {
	[List_Types.Backlog]: 'Backlog',
	[List_Types.InProgress]: 'In progress',
	[List_Types.Ready]: 'Ready',
	[List_Types.Done]: 'Done',
  }
  export { List_Types, List_Types_Show };
